import{useEffect,useState}from"react";import Axios from"axios";export default function QuizData(){const[quizData,setQuizData]=useState({E:"",email:""});return useEffect(()=>{const fetchQuiz=async()=>{try{const response=await Axios.get("http://localhost:8000/fetchQuiz"),quiz=response.data;quiz.length>0&&setQuizData(quiz)}catch(error){console.error("Error fetching user data:",error)}};fetchQuiz()},[]),quizData}